  \"2016-03-19T22:24:47.388112\",\n\t\"name\": \"aamva-ssolv\",\n\t\"isopen\": true,\n\t\"url\":
  null,\n\t\"notes\": \"The American Association for Motor Vehicle Administrators
  (AAMVA), acting as an information conduit between state Motor Vehicle Administration
  (MVAs) amd SSA, submits a verification request electronically to SSOLV when a person
  applies for a driver's license. In response, SSA provides a verification response
  to AAMVA. AAMVA then forwards the results to the requesting MVAs. Verification requests
  include applicant's name, date of birth, and SSN. AAMVA reimburses SSA for the costs
  incurred for these services. In kind, AAMVA passes thess costs on to the individual
  state MVAs. DEB is responsible for technical and analytical support of the SSOLV
  application, as well as providing management information. The Office of Data Exchanges
  is responsible for agreement liaison support and billing services.\",\n\t\"license_title\":
